import React, { useEffect } from 'react';
import './App.css';

function App() {
  useEffect(() => {
    const grid = document.querySelector('.background-grid');
    for (let y = 0; y < 50; y++) {
      for (let x = 0; x < 50; x++) {
        const block = document.createElement('div');
        block.style.setProperty('--x', x); // Custom property for animation delay
        block.style.setProperty('--y', y); // Custom property for animation delay
        grid.appendChild(block);
      }
    }
  }, []);

  return (
    <div className="App">
      <div className="background-grid"></div>
      <header className="App-header">
        <h1>Welcome to the Minecraft-like Page</h1>
        <p>Enjoy the blocky aesthetic in black and white!</p>
      </header>
    </div>
  );
}

export default App;
